import React from 'react';
import Layout from "../../_layouts/default/Layout";

class NotFound extends React.Component {
    render() {
        return (
            <Layout>
                <Typography variant="h4">
                    Not Found | 404
                </Typography>
            </Layout>
        );
    }
}

export default NotFound
